import React, { Component } from "react";
import Navbar from "../components/layouts/navbar";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

class FAQ extends Component {
  question_and_answer = [
    {
      id: 1,
      question: "What?",
      answer: "Hello World"
    },
    {
      id: 2,
      question: "What kinds of dogs are there?",
      answer: "Hello World"
    },
    {
      id: 3,
      question: "How do you acquire a dog?",
      answer: "Hello World"
    }
  ];

  state = {
    isToggle: true
  };
  render() {
    return (
      <React.Fragment>
        <Navbar />
        <div className="ui text container">
          <center>
            <h1 className="warranty">FAQ</h1>
            <br />
          </center>
          <div className="ui accordion">
            {this.question_and_answer.map(data => {
              return (
                <React.Fragment>
                  <div className="active title">{data.question}</div>
                  <div className="active content">
                    <p>
                      A dog is a type of domesticated animal. Known for its
                      loyalty and faithfulness, it can be found as a welcome
                      guest in many households across the world.
                    </p>
                  </div>
                </React.Fragment>
              );
            })}
          </div>
        </div>
      </React.Fragment>
    );
  }
}

export default FAQ;
